import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';
import {BrowserRouter as Router, Route} from "react-router-dom";

const App=()=> {

    return (
      <div>
            <Router>
        <Navbar/>

        <Route exact path="/">  <News size={6} country="in" category="general" /></Route> 
        <Route exact path="/entertainment">  <News size={6} country="in" category="entertainment" /></Route> 
        <Route exact path="/business">  <News size={6} country="in" category="business" /></Route> 
        <Route exact path="/health">  <News size={6} country="in" category="health" /></Route> 
        <Route exact path="/science">  <News size={6} country="in" category="science" /></Route> 
        <Route exact path="/sports">  <News size={6} country="in" category="sports" /></Route> 
        <Route exact path="/technology">  <News size={6} country="in" category="technology" /></Route> 

        <Footer/>
        </Router>
      </div>

    )

}
export default App;
